package DSA;

import java.util.*;

public class stackClass {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		Stack<Integer> a = new Stack<Integer>();
		
		
		
		a.push(20);
		a.push(30);
		
		System.out.println(a);
		
		a.pop();
		System.out.println(a);
		
		a.peek();
		System.out.println(a);
	}

}
